    true,nt"url": null,nt"notes": "Florida DOT (FDOT) installed Vehicle Awareness
    Devices (VADs) on a set of Lynx transit buses as part of a demonstration for the
    ITS World Congress held in Orlando in October 2011.  These VADs recorded vehicle
    data during the World Congress and continue to operate after the World Congress.
     Periodically the VADs are removed from the vehicles and the data files are retrieved.
     FHWA Has confirmed that the data do not contain identification of individual transit
    operators or any other forms for Personally Identifiable Information (PII). The
    data files on the RDE were collected in September and October 2011. The total size
    of the data environment is 696 MB.",nt"license_title": "Other License Specified",nt"extras":
